import React from 'react';
import { Link } from 'react-router-dom';
import classes from './AuthNav.module.css';

const AuthNav = () => (
  <div className={classes.nav}>
      <Link
        to="/signin"
        className={classes.link}
      >
        Sign in
      </Link>
  </div>
);

export default AuthNav;
